<div class="demo-container body vh-100 ">
  <div class="container ">
    <div class="row ">
      <div class="col-lg-6 col-12 mx-auto my-5">
        <div class="text-center image-size-small position-relative my-3">
        <img src="assets/chibiCortada.png" class="rounded-circle p-2 bg-white">
        <div class="icon-camera">
        <a href="" class="text-primary"><i class="lni lni-camera"></i></a>
        </div>
        </div>
        <div class="p-5 bg-white rounded shadow-lg">
          <h3 class="mb-2 text-center pt-5">Login</h3>
          <p class="text-center lead">Por favor, ingresar usuario y contraseña.</p>


          <form #f="ngForm" (ngSubmit)="onLogin()" novalidate>

            <label class="font-500" for="nombreUsuario">Usuario</label>
            <input name="nombreUsuario" id="nombreUsuario" class="form-control form-control-lg mb-3"
                    type="email" [(ngModel)]="nombreUsuario" required>

             <label class="font-500" for="password">Password</label>
            <input name="password" id="password" class="form-control form-control-lg"
